import React from 'react';
import Home from './home';
import About from './about';
import './App.css';
import Navbar from './navbar.jsx';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Navbar/>
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
      </Routes>

    </Router>


  );
}

export default App;
